import React from 'react';
import classes from './NavList.module.css';

const Nav = (props) => (
  <>
    <li className={classes.Li}>
      <a href=''>About</a>
    </li>
    <li className={classes.Li}>
      <a href=''>Blog</a>
    </li>
    <li className={classes.Li}>
      <a href=''>Contact</a>
    </li>
  </>
);

export default Nav;
